import Navbar from '../../components/Nav/Nav';
import './home.css';

const ProgressPage = () => {
  return (
    <div className='progress-page'>
      <Navbar />
      <div className='progress'>Progress Page Under Construction</div>
    </div>
  );
};

export default ProgressPage;
